import React, { useState, ReactNode, Component } from "react";
import InputLabel from "@material-ui/core/InputLabel";
import MenuItem from "@material-ui/core/MenuItem";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";
import { Field, FieldInputProps } from "formik";

function MaterialUISelect(props) {
  return (
    <div>
      <FormControl required={props.required} fullWidth>
        <InputLabel>{props.label}</InputLabel>
        <Select
          name={props.name}
          value={props.value}
          onChange={props.onChange}
          onBlur={props.onBlur}
        >
          {props.children}
        </Select>
      </FormControl>
    </div>
  );
}

class den extends aggregation(Component, FieldInputProps) {
  render() {
    return (
      <div>
        <FormControl required={this.props.required} fullWidth>
          <InputLabel>{this.props.label}</InputLabel>
          <Select
            name={this.props.name}
            value={this.FieldInputProps.value}
            onChange={this.FieldInputProps.onChange}
            onBlur={this.FieldInputProps.onBlur}
          >
            {this.props.children}
          </Select>
        </FormControl>
      </div>
    );
  }
}

export default function SimpleSelect(props) {
  return (
    <div>
      <Field
        name={props.name}
        as={den}
        label={props.label}
        required={props.required}
      >
        {props.items.map((item) => (
          <MenuItem value={item.value} key={item.value}>
            {item.label}
          </MenuItem>
        ))}
      </Field>
    </div>
  );
}
